import { LOGOUT,AUTH } from "../constans/actionType";
const authReducer = (state={authdata:null}, action) =>{
    switch (action.type) {
        case AUTH:
            localStorage.setItem()
            return state;
        default:
            return state;
    }

}
export default authReducer;
